import React, { useState } from 'react';
import { useAuth } from '../AuthContext';
import { useNavigate } from 'react-router-dom';
// import logo from '../assets/logo.png'; // ‚ùå REMOVE - unused
import './DashboardLayout.css';

const DashboardLayout = ({ children }) => {
  // const [sidebarOpen, setSidebarOpen] = useState(true); // ‚ùå REMOVE - unused
  // const [activeTab, setActiveTab] = useState('home'); // ‚ùå REMOVE - unused
  const { currentUser, registeredUsers, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  return (
    <div className="dashboard-layout">
      {/* Top Navbar */}
      <nav className="dashboard-navbar">
        <div className="nav-left">
          {/* Use direct path instead of import */}
          <img src="/assets/logo.png" alt="Logo" className="nav-logo" />
        </div>
        <div className="nav-right">
          <button className="logout-btn" onClick={handleLogout}>
            Logout
          </button>
        </div>
      </nav>

      <div className="dashboard-container">
        {/* Sidebar - Simplified without toggle for now */}
        <aside className="sidebar">
          <div className="sidebar-content">
            <h3 className="sidebar-title">Menu</h3>
            
            <div className="sidebar-menu">
              <button className="menu-item active">
                üè† Home
              </button>
              
              <button className="menu-item">
                üë• Users
              </button>
            </div>
          </div>
        </aside>

        {/* Main Content */}
        <main className="dashboard-main">
          {/* Home Tab Content */}
          <div className="tab-content">
            <h2>Welcome, {currentUser?.firstName}!</h2>
            <div className="user-card">
              <h3>Your Profile</h3>
              <p><strong>Name:</strong> {currentUser?.firstName} {currentUser?.lastName}</p>
              <p><strong>Email:</strong> {currentUser?.email}</p>
              <p><strong>Mobile:</strong> {currentUser?.mobileNumber}</p>
              <p><strong>Login Time:</strong> {currentUser?.loginTime}</p>
            </div>
          </div>

          {/* Users Tab Content - Will implement later */}
        </main>
      </div>
    </div>
  );
};

export default DashboardLayout;
